SELECT AVG("account"."district_id" + "district"."A10") as agg_0, COUNT(*) as agg_1 FROM "client" LEFT OUTER JOIN "disp" ON "client"."client_id" = "disp"."client_id" LEFT OUTER JOIN "district" ON "client"."district_id" = "district"."district_id" LEFT OUTER JOIN "account" ON "disp"."account_id" = "account"."account_id"  WHERE "account"."date" IN ('1993-10-08', '1996-11-24', '1993-06-08', '1993-11-01', '1996-06-25', '1993-02-08', '1996-07-08') AND "client"."birth_date" IN ('1952-08-26', '1920-01-17', '1970-10-07', '1967-07-19', '1971-02-28', '1959-09-14', '1956-02-18', '1970-07-07', '1965-07-25') AND "disp"."account_id" BETWEEN 55274 AND 100139 AND "district"."A3" NOT LIKE '%Prague%' AND ("disp"."client_id" BETWEEN 117081 AND 119248 OR ("disp"."type" = 'OWNER' AND "disp"."client_id" <= 144)) AND "district"."A5" = 12